import styled from "styled-components";

export const Background = styled.div`
    height : 25vh;
    width : 100%;
    background-color : #d2d2d2;
    top : 0;
`;

export const Logo = styled.img`
    height : 13vh;
    display: block;
    margin-right : auto;
    margin-left: auto;
    padding-top : 4vh;
`
